Cumin is a Configuration Language like JSON, YAML or TOML, but this is Mini-Programmable, Structured and Typed. cumin has Rust -like syntax. /// example.cumin struct User { id: Int, name: String,
} let names = [ User(1, "cympfh"), User(2, "Taro"), User(3, "John"),
]; names The compiler cuminc generates JSON from cumin. $ cuminc ./example.cumin
