You can introduce new types with struct. struct X { x: Int, n: Nat, s: String,
} Each fields can have default Values. struct X { x: Int, n: Nat = 0, s: String,
} NOTE : Cumin always allows comma-trailing. The last , is optional completely, but I recommend putting ','. This Statement syntax can be denoted as <struct> in the following BNF. <struct> ::= struct <id> { <fields> }
<fields> ::= <field> | <field> `,` | <field> `,` <fields>
<fields> ::= <id> `:` <type> | <id> `:` <type> `=` <expression> where <id> ::= (identifier) <type> ::= (type name) <expression> ::= (Expression)

